package cn.com.evo.integration.guangxi.pay.dto.pay.dto.query;import javax.xml.bind.annotation.XmlElement;import javax.xml.bind.annotation.XmlType;/** * @Description: * @author: lu.xin * @create: 2019-05-21 10:59 AM **/@XmlType(propOrder = {        "tariffId",        "priceValue",        "billingType",        "billingTypeName",})public class TariffDto {    private String tariffId;    private String priceValue;    private String billingType;    private String billingTypeName;    @XmlElement(name = "tariffId")    public String getTariffId() {        return tariffId;    }    @XmlElement(name = "priceValue")    public String getPriceValue() {        return priceValue;    }    @XmlElement(name = "billingType")    public String getBillingType() {        return billingType;    }    @XmlElement(name = "billingTypeName")    public String getBillingTypeName() {        return billingTypeName;    }    public void setTariffId(String tariffId) {        this.tariffId = tariffId;    }    public void setPriceValue(String priceValue) {        this.priceValue = priceValue;    }    public void setBillingType(String billingType) {        this.billingType = billingType;    }    public void setBillingTypeName(String billingTypeName) {        this.billingTypeName = billingTypeName;    }}